import React, { Component } from 'react';
import { Row, Col, Pagination, PaginationItem, PaginationLink, Input } from 'reactstrap';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faAngleDoubleLeft, faAngleLeft, faAngleRight, faAngleDoubleRight } from '@fortawesome/free-solid-svg-icons';

class ObjPag extends Component {

    constructor(props) {
        super(props);
    }

    callPagination(action, pagNum, objParent){

        if(action == "back"){ pagNum = parseInt(objParent.info.pag)-1; }

        if(action == "allback"){ pagNum = 1; }

        if(action == "forward"){ pagNum = parseInt(objParent.info.pag)+1; }

        if(action == "allforward"){ pagNum = parseInt(objParent.info.NumPages); }

        //Si el valor de registros visualizados por pagina cambia y se recupera la pagina en la que nos encontramos
        if(action == "cRegister"){ pagNum = objParent.info.pag; }

        //Llamo a la funcion padre con la posici√≥n de paginacion
        objParent.pagLoad(pagNum,objParent.info.limit);

    }

    paginationRender(rendPage, pag){

        var start = (pag-10)+1;
        if(start <= 0) start = 1;
        var end =  start+10;

        if(rendPage < end) end =  rendPage+1;

        const tempPag = [];
        for (let i=start; i<end; i++) {
            if(i == pag){
                tempPag.push(
                    <PaginationItem key={"pag"+i} active>
                        <PaginationLink onClick={this.callPagination.bind(this, "nunPag", ""+i, this.props)}>
                            {i}
                        </PaginationLink>
                    </PaginationItem>
                )
            }else{
                tempPag.push(
                    <PaginationItem key={"pag"+i}>
                        <PaginationLink onClick={this.callPagination.bind(this, "nunPag", ""+i, this.props)}>
                            {i}
                        </PaginationLink>
                    </PaginationItem>
                )
            }
        }
        return tempPag;
    }

    pagRender(e,value){

        const NumPages = this.props.info.NumPages;
        const pag = this.props.info.pag;
        var rendPage = 0;
        rendPage = (NumPages < 10)? NumPages : 10;
        const pagTemp = this.paginationRender(rendPage,pag);

        if(parseInt(this.props.info.NumPages) <= 10){
            return (
                <Pagination >
                    <PaginationItem disabled key="allback">
                        <PaginationLink onClick={this.callPagination.bind(this, "allback", null, this.props)}>
                            <FontAwesomeIcon  icon={faAngleDoubleLeft} />
                        </PaginationLink>
                    </PaginationItem>
                    <PaginationItem disabled key="back">
                        <PaginationLink onClick={this.callPagination.bind(this, "back", null, this.props)}>
                            <FontAwesomeIcon  icon={faAngleLeft} />
                        </PaginationLink>
                    </PaginationItem>
                    {pagTemp}
                    <PaginationItem disabled key="forward">
                        <PaginationLink onClick={this.callPagination.bind(this, "forward", null, this.props)}>
                            <FontAwesomeIcon  icon={faAngleRight} />
                        </PaginationLink>
                    </PaginationItem>
                    <PaginationItem disabled key="allforward">
                        <PaginationLink onClick={this.callPagination.bind(this, "allforward", null, this.props)}>
                            <FontAwesomeIcon  icon={faAngleDoubleRight} />
                        </PaginationLink>
                    </PaginationItem>
                </Pagination>
            );
        }

        if(parseInt(this.props.info.pag) <= 10){
            return (
                <Pagination >
                    <PaginationItem disabled key="allback">
                        <PaginationLink onClick={this.callPagination.bind(this, "allback", null, this.props)}>
                            <FontAwesomeIcon  icon={faAngleDoubleLeft} />
                        </PaginationLink>
                    </PaginationItem>
                    <PaginationItem disabled key="back">
                        <PaginationLink onClick={this.callPagination.bind(this, "back", null, this.props)}>
                            <FontAwesomeIcon  icon={faAngleLeft} />
                        </PaginationLink>
                    </PaginationItem>
                    {pagTemp}
                    <PaginationItem  key="forward">
                        <PaginationLink onClick={this.callPagination.bind(this, "forward", null, this.props)}>
                            <FontAwesomeIcon  icon={faAngleRight} />
                        </PaginationLink>
                    </PaginationItem>
                    <PaginationItem  key="allforward">
                        <PaginationLink onClick={this.callPagination.bind(this, "allforward", null, this.props)}>
                            <FontAwesomeIcon  icon={faAngleDoubleRight} />
                        </PaginationLink>
                    </PaginationItem>
                </Pagination>
            );
        }

        if(parseInt(this.props.info.pag) >= (parseInt(this.props.info.NumPages))){
            return (
                <Pagination >
                    <PaginationItem  key="allback">
                        <PaginationLink onClick={this.callPagination.bind(this, "allback", null, this.props)}>
                            <FontAwesomeIcon  icon={faAngleDoubleLeft} />
                        </PaginationLink>
                    </PaginationItem>
                    <PaginationItem  key="back">
                        <PaginationLink onClick={this.callPagination.bind(this, "back", null, this.props)}>
                            <FontAwesomeIcon  icon={faAngleLeft} />
                        </PaginationLink>
                    </PaginationItem>
                    {pagTemp}
                    <PaginationItem disabled key="forward">
                        <PaginationLink onClick={this.callPagination.bind(this, "forward", null, this.props)}>
                            <FontAwesomeIcon  icon={faAngleRight} />
                        </PaginationLink>
                    </PaginationItem>
                    <PaginationItem disabled key="allforward">
                        <PaginationLink onClick={this.callPagination.bind(this, "allforward", null, this.props)}>
                            <FontAwesomeIcon  icon={faAngleDoubleRight} />
                        </PaginationLink>
                    </PaginationItem>
                </Pagination>
            );
        }
        else{
            return (
                <Pagination >
                    <PaginationItem  key="allback">
                        <PaginationLink onClick={this.callPagination.bind(this, "allback", null, this.props)}>
                            <FontAwesomeIcon  icon={faAngleDoubleLeft} />
                        </PaginationLink>
                    </PaginationItem>
                    <PaginationItem  key="back">
                        <PaginationLink onClick={this.callPagination.bind(this, "back", null, this.props)}>
                            <FontAwesomeIcon  icon={faAngleLeft} />
                        </PaginationLink>
                    </PaginationItem>
                    {pagTemp}
                    <PaginationItem  key="forward">
                        <PaginationLink onClick={this.callPagination.bind(this, "forward", null, this.props)}>
                            <FontAwesomeIcon  icon={faAngleRight} />
                        </PaginationLink>
                    </PaginationItem>
                    <PaginationItem  key="allforward">
                        <PaginationLink onClick={this.callPagination.bind(this, "allforward", null, this.props)}>
                            <FontAwesomeIcon  icon={faAngleDoubleRight} />
                        </PaginationLink>
                    </PaginationItem>
                </Pagination>
            );
        }

    }

    option(e,value){
        const temp = [];
        temp.push(<option key={"opt0"} value="3333">{this.props.info.limit}</option>);
        if(this.props.info.limit != 5)temp.push(<option key="opt5" value="5">5</option>);
        if(this.props.info.limit != 10)temp.push(<option key="opt10" value="10" >10</option>);
        if(this.props.info.limit != 20)temp.push(<option key="opt20" value="20" >20</option>);
        if(this.props.info.limit != 50)temp.push(<option key="opt50" value="50">50</option>);
        if(this.props.info.limit != 100)temp.push(<option key="opt100" value="100" >100</option> );
        if(this.props.info.limit != 10000000)temp.push(<option key="opt100" value="10000000" >Todos</option> );
        return temp;
    }

    render(){

        const propss = this.props.pagLoad.bind();

        return (
            <Row>
                <Col>
                    <Input type="select" name="select" id="pagNum" onChange={ 
                        (event) => {
                            const limit = event.target.value;
                            propss("cRegister",limit);
                        }
                    }> 
                        {this.option()}      
                    </Input>
                </Col>
                <Col>
                    {this.pagRender()}
                </Col>
            </Row>

        );
    }

}

export default ObjPag;
